    89→  showSymbol: boolean = true
    90→): string {
    91→  if (amount === null || amount === undefined) return '-';
    92→
    93→  const formatted = new Intl.NumberFormat('th-TH', {
    94→    minimumFractionDigits: 0,
    95→    maximumFractionDigits: 2,
    96→  }).format(amount);
    97→
    98→  return showSymbol ? `฿${formatted}` : formatted;
    99→}
