   102→ * Format date using Thai locale
   103→ * @param dateString - ISO date string
   104→ * @param options - Intl.DateTimeFormatOptions
   105→ * @returns Formatted date string
   106→ */
   107→export function formatDate(
   108→  dateString: string,
   109→  options?: Intl.DateTimeFormatOptions
   110→): string {
   111→  const date = new Date(dateString);
   112→
   113→  const defaultOptions: Intl.DateTimeFormatOptions = {
   114→    year: 'numeric',
   115→    month: 'short',
   116→    day: 'numeric',
   117→    hour: '2-digit',
   118→    minute: '2-digit',
   119→  };
   120→
   121→  return new Intl.DateTimeFormat('th-TH', options || defaultOptions).format(date);
   122→}
